import React from 'react';
import { BrowserRouter as Router } from "react-router-dom";
import {
  Navbar,
  ClippedDrawer,
} from "./components";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <ClippedDrawer/>
      </Router>
    </div>
  );
}

export default App;
